import React, {Component} from 'react';
import { BrowserRouter, Route } from 'react-router';
import './App.css';
import MailLogin from './pages/MailLogin';


class App extends Component {


  render() {
    return (
      <BrowserRouter>
        <Route path="/" component={MailLogin}/>
      </BrowserRouter>
    );
  }
}

export default App;
